var thirty = "data:audio/midi;base64,";

var waldstein = "data:audio/midi;base64,";


window.onload = function () {
	var handleError = function(err) {
		console.log(err);
	};
	var handleProgress = function(state, percent, desc) {
		console.log(state, percent, desc);
	};
	///
	MIDI.loader = new widget.Loader;
	MIDI.loadPlugin({
		soundfontUrl: "./MIDI.js-dev/examples/soundfont/",
		instrument: "acoustic_grand_piano",
		onprogress: handleProgress,
		callback: function() {
			var player = MIDI.Player;
			player.timeWarp = 1; // speed the song is played back
			player.loadFile(thirty, player.start, handleProgress, handleError);
      player.addListener(listenerCallback);
      player.start();
		}
	});
};

var listenerCallback = function(data) {
  var now = data.now; // where we are now
  var end = data.end; // time when song ends
  var channel = data.channel; // channel note is playing on
  var message = data.message; // 128 is noteOff, 144 is noteOn
  var note = data.note; // the note
  var velocity = data.velocity; // the velocity of the note
  if (message === 144) {
    MIDI.noteOn(0, note, velocity, 0);
    svg.append("circle")
      .attr("cx", note * 10)
      .attr("cy", 50)
      .attr("r", velocity / 5)
      .attr("opacity", 1)
      .transition()
      .duration(50)
      .attr("r", velocity / 3)
      .transition()
      .duration(2000)
      .ease("sin")
      .attr("cy", height - 50)
      .attr("r", 0)
      .attr("opacity", 0);
  } else if (message === 128) {
    MIDI.noteOff(0, note, 0);
  }
};

